<head>
    <meta http-equiv="content-type" content="text/html;charset=utf-8">
    <title>分支</title>
    <script>
       /* Branching Singleton(Skeleton) */
       var MyNamespace = {};
       MyNamespace.Singleton = (function(){
        var objectA = {
            method1: function(){}
        };

        var objectB = {
            method1: function(){}
        };

        var someCondition;
        return (someCondition) ? objectA:objectB;
        /*
            分支技术并不总是高效的，objectA和objectB被创建出来并保存到内存中，但派上用场的只有一个。
            在考虑使用这种技术的时候，必须在缩短计算时间和占用更多内存之间权衡
        */
       })();


       /*
            SimpleXHRFactory singleton
            分支对象较小而判断使用哪个对象的开销较大
       */

       var SimpleXHRFactory = (function(){
            var standard = {
                createXHRObject: function(){
                    return new XMLHttpRequest();
                }
            };

            var activeXNew = {
                createXHRObject: function(){
                    return new ActiveXObject('Msxml2.XMLHTTP');
                }
            };

            var activeXOld = {
                createXHRObject: function(){
                    return new ActiveXObject('Microsoft.XMLHTTP');
                }
            };

            var XHR;
            try{
                XHR = standard.createXHRObject();
                return standard;
            }catch(e){
                try{
                    XHR = activeXNew.createXHRObject();
                    return activeXNew;
                }catch(e){
                    try{
                        XNR = activeXOld.createXHRObject();
                        return activeXOld;
                    }catch(e){
                        return new Error('No XHR object found in this environment')
                    }
                }
            }
       })();
    </script>
